          <MenuItem value={30}>Thirty</MenuItem>
        </Select>
      </FormControl>  
                    </div>
                    <div>
                    <TextField
                    id="standard-full-width"
                    label="Label"
                    style={{ margin: 5 }}

                    helperText="Full width!"
                    fullWidth
                    margin="normal"
                    InputLabelProps={{
                        shrink: true,
                    }}
                    variant="filled"
                    />
                    </div>
                </form>
                </Typography>
      </Container>
    </React.Fragment>

            </>  
        )



}


export default create_project
